import './Projects.css';

function Projects(){
    return(
        <div className='projects'>
                <div className='projects-wrapper'>
                    <section>
                        <div className='projects-header'>
                        <hr></hr>
                        <h1>Projects</h1>
                        <hr></hr>
                        </div>
                    </section>
            </div>
        </div>
    );
}

export default Projects
